import React from 'react';
import {Switch, Route} from 'react-router-dom';
import NavBar from '../../components/HOMEPAGE/navigation/navigation.component';
import HomePage from './pages/homepage/homepage.component';
import './App.css';

function App() {
  return (
    <div className="App">
      <NavBar />
      <Switch>
        <Route exact path="/" component={HomePage} />
      </Switch>

    </div>
  );
}

export default App;
